export enum ratingToText {
    VeryBad = 1,
    Bad = 2,
    Normal = 3,
    Good = 4,
    VeryGood = 5,
}

export const MAX_RATING = 5;

export const GUITAR_STEP = 9;

export enum AppRoute {
    Main = '/',
    Guitar = '/guitars/',
    NoFoundScreen = '/*',
}

export const FIRST_INDEX_PAGINATION = 0;
export const LAST_INDEX_PAGINATION = -1;
export const STEP_PAGINATION = 1;
